import json
import re
import subprocess
import time

import never_jscore


with open('env.js',encoding='utf-8')as f:
    js_env = f.read()

ctx = never_jscore.Context(enable_logging=False)
ctx.compile(js_env)


def new_get_dynamics(response_text):
    akm_number_map = re.findall(r'(\s*var\s+(\w+)\s*=\s*\w+\s*\|\|\s*\w+\(\);)', response_text)[0]

    response_text = response_text.replace(akm_number_map[0], akm_number_map[0] + f'window.akm_number ={akm_number_map[1]};')
    t = time.time()

    success_message = ctx.call('akm_dict_hook',response_text)
    print(f'time:{time.time()-t}')
    success_message = json.loads(success_message)
    print(success_message)

    sx = success_message['mst'][28]
    sx = sx['dvc'].split(',')[2]
    akm_numer = success_message['akm_number'][1]
    akm_ver = success_message['ver']
    din = success_message['din']
    din_keys = [list(item.keys())[0] for item in din]

    return {'sx': sx, 'akm_numer': akm_numer, 'akm_ver': akm_ver, 'din_keys': din_keys}


